import * as actionType from '../constants/actionTypes';

const usersReducer = (users = [], action) => {
  switch (action.type) {
    case actionType.FETCH_ALL:
        console.log(action.payload);
        return action.payload;
    default:
      return users;
  }
};

export default usersReducer;
